Given a rectangle \(ABCD\) with \(|AB| : |BC| = 2 : 1\), let's denote \(|AB| = 2a\) and \(|BC| = a\). The area of rectangle \(ABCD\) is then:

\[
\text{Area of } ABCD = |AB| \times |BC| = 2a \times a = 2a^2
\]

Next, consider the points \(K, L, M, N\) on the sides \(AB, BC, CD, DA\) respectively such that \(KLMN\) is a rectangle and \(|KL| : |LM| = 3 : 1\). Let's place the rectangle \(ABCD\) in the coordinate plane with \(A = (0, 0)\), \(B = (2a, 0)\), \(C = (2a, a)\), and \(D = (0, a)\).

Assume the coordinates of \(K\) are \((x, 0)\), \(L\) are \((2a, y)\), \(M\) are \((2a - x, a)\), and \(N\) are \((0, a - y)\). Since \(KLMN\) is a rectangle, the lengths of its sides are \(|KL| = 2a - 2x\) and \(|LM| = a - 2y\). Given the ratio \(|KL| : |LM| = 3 : 1\), we have:

\[
2a - 2x = 3(a - 2y) \implies 2a - 2x = 3a - 6y \implies -2x + 6y = a \implies x = 3y - \frac{a}{2}
\]

Since \(K\) is on \(AB\), \(0 \leq x \leq 2a\). Therefore, \(0 \leq 3y - \frac{a}{2} \leq 2a\). This gives us the range for \(y\):

\[
\frac{a}{6} \leq y \leq \frac{5a}{6}
\]

The area of rectangle \(KLMN\) is:

\[
\text{Area of } KLMN = |KL| \times |LM| = (2a - 2x) \times (a - 2y) = 2(a - x) \times (a - 2y) = 2\left(a - \left(3y - \frac{a}{2}\right)\right) \times (a - 2y) = 2\left(a - 3y + \frac{a}{2}\right) \times (a - 2y) = 2\left(\frac{3a}{2} - 3y\right) \times (a - 2y) = 3(a - 2y)^2
\]

To find the average area of \(KLMN\) over the range of \(y\) from \(\frac{a}{6}\) to \(\frac{5a}{6}\), we integrate the area function with respect to \(y\) and divide by the interval length:

\[
\text{Average area of } KLMN = \frac{1}{\frac{5a}{6} - \frac{a}{6}} \int_{\frac{a}{6}}^{\frac{5a}{6}} 3(a - 2y)^2 \, dy = \frac{1}{\frac{4a}{6}} \int_{\frac{a}{6}}^{\frac{5a}{6}} 3(a - 2y)^2 \, dy = \frac{3}{2a} \int_{\frac{a}{6}}^{\frac{5a}{6}} 3(a - 2y)^2 \, dy = \frac{9}{2a} \int_{\frac{a}{6}}^{\frac{5a}{6}} (a - 2y)^2 \, dy
\]

Let \(u = a - 2y\). Then \(du = -2 \, dy\) and the limits of integration change from \(y = \frac{a}{6}\) to \(y = \frac{5a}{6}\) to \(u = a - 2\left(\frac{a}{6}\right) = \frac{2a}{3}\) to \(u = a - 2\left(\frac{5a}{6}\right) = -\frac{4a}{3}\). The integral becomes:

\[
\int_{\frac{a}{6}}^{\frac{5a}{6}} (a - 2y)^2 \, dy = -\frac{1}{2} \int_{\frac{2a}{3}}^{-\frac{4a}{3}} u^2 \, du = \frac{1}{2} \int_{-\frac{4a}{3}}^{\frac{2a}{3}} u^2 \, du = \frac{1}{2} \left[ \frac{u^3}{3} \right]_{-\frac{4a}{3}}^{\frac{2a}{3}} = \frac{1}{2} \left( \frac{\left(\frac{2a}{3}\right)^3}{3} - \frac{\left(-\frac{4a}{3}\right)^3}{3} \right) = \frac{1}{2} \left( \frac{8a^3}{27 \cdot 3} + \frac{64a^3}{27 \cdot 3} \right) = \frac{1}{2} \left( \frac{72a^3}{81} \right) = \frac{1}{2} \left( \frac{8a^3}{9} \right) = \frac{4a^3}{9}
\]

Therefore, the average area of \(KLMN\) is:

\[
\text{Average area of } KLMN = \frac{9}{2a} \cdot \frac{4a^3}{9} = \frac{4a^2}{2} = 2a^2
\]

